    "Строим комбинированные быстровозводимые энергоэффективные, современные ЭКО дома 21 века.": "Մենք կառուցում ենք 21-րդ դարի համակցված, արագ կառուցվող, էներգաարդյունավետ, ժամանակակից ԷԿՈ տներ։",
