    "Паропроницаемость — стены дышат, регулируя влажность в помещении": "Պարունակության թաթեւությունը — սեռնաքաշության թաթեւության միջոցով համառոտ լույսը",
    "Влагостойкость — в 5 раз выше, чем у газоблоков": "Խումբների նախագծի բնութագիրը — այն վաստակավորված լույսը, որը 5 անգամ բարձր է բլոկներից",
    "Отличная теплоизоляция и теплосбережение - зимой при -20С дом теряет 1С за сутки": "Լավագույն ջերմաստիճանի աշխատանքը եւ ջերմության պահպանումը — -20 ° ամսական ջանամիտը առաջին օրը 1 ° է կորցրում",
    "Комфорт": "Ընդունում",
    "Увеличение внутренней полезной площади помещений здания - как дополнительный приятный бонус.": "Կառուցվածքի ներկայացման մասին — հետադարձ ավելին հատուկ ուրիշ զեկույց։",
    "Сокращение расходов на приобретение и монтаж дополнительного утеплителя и на оплату энергоресурсов при дальнейшей эксплуатации объекта.": "Եւթե հասարակական կորցնեք — լրացուցիչ ջանամիտություն ունեցող մանրադրական ջրի արտադրիչների գներին եւ տեղեկացնեք ավելի հետաքրքիր պահպանման հետազոտությունների համար։",
    "Экономия расхода раствора до 70% за счет точности геометрических размеров и сокращения толщины стены": "Պատրաստեք իրար հատուկ գործընթացներ — տարբերակը կորցրեք ձայնավորությամբ, բլոկների համառոտ չափերը ամբողջությամբ ճշգրտության միջոցով։",
    "Снижение трудозатрат за счет малого веса в 1,5 раза": "Հասարակական երկրաչափություն — աշխատանքի մատուցումը կարճատությամբ կատարեք 1,5 անգամ կերպար կուրս։",
    "Снижение стоимости 1 кв. м стены за счет материалоемкости в 1,5 - 2 раза": "Շեղման չափսը — հարթավորվածության չափսը 1,5 - 2 անգամ է փոքր",
    "Высокая звукоизоляция — блок до 20 см гасит звук до 70 д": "Ալյումինամակարարվում է ավելի բարձր խորանարդի լուսավորությունը — եւ կլինի ավելի ընթացիկ",
